" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Dermatologic complications of the drugs used for immunosuppression after liver transplantation",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Drug",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comments",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Azathioprine",
"       </td>",
"       <td>",
"        Acne, alopecia, angioedema, isolated localized exanthem, erosive stomatitis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Corticosteroids",
"       </td>",
"       <td>",
"        Acne, cushingoid appearance, ecchymosis, hypertrichosis, delayed wound healing, striae",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cyclosporine",
"       </td>",
"       <td>",
"        Anaphylactic reactions, edema of the face and extremities,",
"epidermal cysts, folliculitis, gingival hyperplasia, hidradenitis,",
"hypertrichosis, onychopathy sebaceous hyperplasia, urticaria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Mycophenolate",
"       </td>",
"       <td>",
"        Acne, edema of the face and of the extremities, erosive stomatitis, mofetil hypersudation, thrombocytopenic purpura",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Rapamycin",
"       </td>",
"       <td>",
"        Rash, acne, leucocytoclastic vasculitis, capillary leak syndrome, thrombocytopenic purpura",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tacrolimus",
"       </td>",
"       <td>",
"        Gingival hyperplasia, thrombocytopenic purpura",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
